(6, 0, 423492, 2, 'L', 'R3B02Q005', '<p>Jabatan</p>\n', '', '<span lang=\"en\" style=\"font-size:12pt;\" xml:lang=\"en\"><span style=\"line-height:115%;\"><span style=\"font-family:\'Times New Roman\', serif;\">Pilih jabatan anda di satuan kerja saat ini. Apabila jabatan yang anda duduki tidak ada pada pilihan, silakan masukkan jabatan anda pada pilihan Lainnya.</span></span></span>', 'Y', 'Y', 5, 'en', 0, 0, '1', ''),
