(17, 0, 423492, 7, 'F', 'R3B04Q010', '<p style=\"text-align: justify;\">Jika terjadi bencana, fasilitas apa yang ada di satuan kerja Bapak/Ibu/Saudara/i yang dapat digunakan untuk mencapai tempat yang aman?</p>\n<!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#r3b04q010\" data-toggle=\"modal\" type=\"button\">Penjelasan</button><!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung-->\n\n<div aria-labelledby=\"myModalLabel\" class=\"modal fade\" id=\"r3b04q010\" role=\"dialog\" tabindex=\"-1\">\n<div class=\"modal-dialog\" role=\"document\">\n<div class=\"modal-content\">\n<div class=\"modal-header\"><button aria-label=\"Close\" class=\"close\" data-dismiss=\"modal\" type=\"button\"><span aria-hidden=\"true\">×</span></button>\n\n<h4 class=\"modal-title\" id=\"myModalLabel\">Konsep dan Definisi</h4>\n</div>\n\n<div class=\"modal-body\">\n<ol>\n	<li>Jalur evakuasi\n	<p>Jalur Evakuasi adalah jalur khusus yang menghubungkan semua area ke area yang aman (misalnya titik kumpul).</p>\n	</li>\n	<li>Pintu darurat\n	<p>Pintu darurat adalah pintu khusus yang hanya dilalui dalam keadaan terpaksa. Pintu darurat dipasang sebagai sarana jalan keluar atau pelarian dari keadaan bahaya.</p>\n	</li>\n	<li>Tangga darurat\n	<p>Tangga darurat adalah tangga yang digunakan khusus untuk penyelamatan bila terjadi bencana. Tangga yang menghubungkan kegiatan vertikal dalam bangunan yang digunakan hanya dalam keadaan darurat.</p>\n	</li>\n	<li>Titik Kumpul\n	<p>Titik kumpul adalah tempat yang digunakan bagi pengguna bangunan gedung dan pengunjung bangunan gedung untuk berkumpul setelah proses evakuasi.</p>\n	</li>\n</ol>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-default\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '<p style=\"margin-bottom:12pt;text-align:justify;margin:0cm;\"><span style=\"font-size:11pt;\"><span style=\"line-height:115%;\"><span style=\"font-family:Arial, sans-serif;\"><span lang=\"en\" style=\"font-size:12pt;\" xml:lang=\"en\"><span style=\"line-height:115%;\"><span style=\"font-family:\'Times New Roman\', serif;\">Isikan dengan ada atau tidaknya fasilitas yang dapat digunakan untuk mencapai tempat aman ketika terjadi bencana alam di satuan kerja BPS. </span></span></span></span></span></span></p>\n', 'N', 'Y', 10, 'en', 0, 0, '1', ''),
(17, 0, 423492, 7, 'F', 'R3B04Q010', '<p style=\"text-align: justify;\">Jika terjadi bencana, fasilitas apa yang ada di satuan kerja Bapak/Ibu/Saudara/i yang dapat digunakan untuk mencapai tempat yang aman?</p>\n<!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#r3b04q010\" data-toggle=\"modal\" type=\"button\">Penjelasan</button><!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung-->\n\n<div aria-labelledby=\"myModalLabel\" class=\"modal fade\" id=\"r3b04q010\" role=\"dialog\" tabindex=\"-1\">\n<div class=\"modal-dialog\" role=\"document\">\n<div class=\"modal-content\">\n<div class=\"modal-header\"><button aria-label=\"Close\" class=\"close\" data-dismiss=\"modal\" type=\"button\"><span aria-hidden=\"true\">×</span></button>\n\n<h4 class=\"modal-title\" id=\"myModalLabel\">Konsep dan Definisi</h4>\n</div>\n\n<div class=\"modal-body\">\n<ol>\n	<li>Jalur evakuasi\n	<p>Jalur Evakuasi adalah jalur khusus yang menghubungkan semua area ke area yang aman (misalnya titik kumpul).</p>\n	</li>\n	<li>Pintu darurat\n	<p>Pintu darurat adalah pintu khusus yang hanya dilalui dalam keadaan terpaksa. Pintu darurat dipasang sebagai sarana jalan keluar atau pelarian dari keadaan bahaya.</p>\n	</li>\n	<li>Tangga darurat\n	<p>Tangga darurat adalah tangga yang digunakan khusus untuk penyelamatan bila terjadi bencana. Tangga yang menghubungkan kegiatan vertikal dalam bangunan yang digunakan hanya dalam keadaan darurat.</p>\n	</li>\n	<li>Titik Kumpul\n	<p>Titik kumpul adalah tempat yang digunakan bagi pengguna bangunan gedung dan pengunjung bangunan gedung untuk berkumpul setelah proses evakuasi.</p>\n	</li>\n</ol>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-default\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '<p style=\"margin-bottom:12pt;text-align:justify;margin:0cm;\"><span style=\"font-size:11pt;\"><span style=\"line-height:115%;\"><span style=\"font-family:Arial, sans-serif;\"><span lang=\"en\" style=\"font-size:12pt;\" xml:lang=\"en\"><span style=\"line-height:115%;\"><span style=\"font-family:\'Times New Roman\', serif;\">Isikan dengan ada atau tidaknya fasilitas yang dapat digunakan untuk mencapai tempat aman ketika terjadi bencana alam di satuan kerja BPS. </span></span></span></span></span></span></p>\n', 'N', 'Y', 10, 'id', 0, 0, '1', ''),
(18, 0, 423492, 7, 'F', 'R3B04Q009', '<p style=\"text-align: justify;\">Apa metode yang dilakukan satuan kerja Bapak/Ibu/Saudara/i dalam memberitahukan pegawainya tentang sebuah kemungkinan terjadinya bencana?</p>\n<!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#r3b04q009\" data-toggle=\"modal\" type=\"button\">Penjelasan</button><!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung-->\n\n<div aria-labelledby=\"myModalLabel\" class=\"modal fade\" id=\"r3b04q009\" role=\"dialog\" tabindex=\"-1\">\n<div class=\"modal-dialog\" role=\"document\">\n<div class=\"modal-content\">\n<div class=\"modal-header\"><button aria-label=\"Close\" class=\"close\" data-dismiss=\"modal\" type=\"button\"><span aria-hidden=\"true\">×</span></button>\n\n<h4 class=\"modal-title\" id=\"myModalLabel\">Konsep dan Definisi</h4>\n</div>\n\n<div class=\"modal-body\">\n<p>Isikan “Ya” jika terdapat minimal satu sistem peringatan dini bencana di Satuan Kerja Anda, dapat  berupa sistem peringatan dini tradisional (kentongan, lonceng) maupun sistem peringatan dini modern (sirine, detector asap, fire alarm, radio, televisi, sms, internet, media cetak).</p>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-default\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'Y', 9, 'en', 0, 0, '(((!is_empty(423492X4X19.NAOK) && (423492X4X19.NAOK == 2)))) or (((!is_empty(423492X4X19.NAOK) && (423492X4X19.NAOK == 1))))', ''),
