(19, 0, 423492, 7, 'L', 'R3B04Q007', '<p style=\"text-align: justify;\">Apakah satuan kerja Bapak/Ibu/Saudara/i pernah mendapatkan informasi sumber peringatan bencana?</p>\n<!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#r3b04q007\" data-toggle=\"modal\" type=\"button\">Penjelasan</button><!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung-->\n\n<div aria-labelledby=\"myModalLabel\" class=\"modal fade\" id=\"r3b04q007\" role=\"dialog\" tabindex=\"-1\">\n<div class=\"modal-dialog\" role=\"document\">\n<div class=\"modal-content\">\n<div class=\"modal-header\"><button aria-label=\"Close\" class=\"close\" data-dismiss=\"modal\" type=\"button\"><span aria-hidden=\"true\">×</span></button>\n\n<h4 class=\"modal-title\" id=\"myModalLabel\">Konsep dan Definisi</h4>\n</div>\n\n<div class=\"modal-body\">\n<p>Informasi yang dimaksud adalah sumber informasi yang berkaitan dengan peringatan bencana, yang dapat diperoleh dari pemerintah pusat/daerah, media elektronik, media cetak, dan media sosial.</p>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-default\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'Y', 7, 'en', 0, 0, '1', ''),
(19, 0, 423492, 7, 'L', 'R3B04Q007', '<p style=\"text-align: justify;\">Apakah satuan kerja Bapak/Ibu/Saudara/i pernah mendapatkan informasi sumber peringatan bencana?</p>\n<!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#r3b04q007\" data-toggle=\"modal\" type=\"button\">Penjelasan</button><!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung-->\n\n<div aria-labelledby=\"myModalLabel\" class=\"modal fade\" id=\"r3b04q007\" role=\"dialog\" tabindex=\"-1\">\n<div class=\"modal-dialog\" role=\"document\">\n<div class=\"modal-content\">\n<div class=\"modal-header\"><button aria-label=\"Close\" class=\"close\" data-dismiss=\"modal\" type=\"button\"><span aria-hidden=\"true\">×</span></button>\n\n<h4 class=\"modal-title\" id=\"myModalLabel\">Konsep dan Definisi</h4>\n</div>\n\n<div class=\"modal-body\">\n<p>Informasi yang dimaksud adalah sumber informasi yang berkaitan dengan peringatan bencana, yang dapat diperoleh dari pemerintah pusat/daerah, media elektronik, media cetak, dan media sosial.</p>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-default\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'Y', 7, 'id', 0, 0, '1', ''),
(20, 0, 423492, 7, 'M', 'R3B04Q008', '<p>Darimanakah sumber peringatan bencana tersebut?</p>\n<!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#r3b04q008\" data-toggle=\"modal\" type=\"button\">Penjelasan</button><!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung-->\n\n<div aria-labelledby=\"myModalLabel\" class=\"modal fade\" id=\"r3b04q008\" role=\"dialog\" tabindex=\"-1\">\n<div class=\"modal-dialog\" role=\"document\">\n<div class=\"modal-content\">\n<div class=\"modal-header\"><button aria-label=\"Close\" class=\"close\" data-dismiss=\"modal\" type=\"button\"><span aria-hidden=\"true\">×</span></button>\n\n<h4 class=\"modal-title\" id=\"myModalLabel\">Konsep dan Definisi</h4>\n</div>\n\n<div class=\"modal-body\">\n<p>Informasi yang dimaksud adalah sumber informasi yang berkaitan dengan peringatan bencana, yang dapat diperoleh dari pemerintah pusat/daerah, media elektronik, media cetak, dan media sosial.</p>\n\n<ol>\n	<li>Sumber peringatan bencana yang berasal dari Pemerintah Pusat maupun Daerah yaitu informasi yang berasal dari Lembaga Pemerintah seperti BMKG, BNPB, Kementerian ESDM dan BPBD.</li>\n	<li>Sumber peringatan bencana yang berasal dari Media Elektronik terbagi menjadi dua macam, diantaranya radio dan televisi.</li>\n	<li>Sumber peringatan bencana yang berasal dari Media Cetak terbagi menjadi beberapa macam diantaranya seperti surat kabar, majalah, buku, dan sejenisnya.</li>\n	<li>Sumber peringatan bencana yang berasal dari Media Sosial atau online meliputi website, Facebook, Twitter, dan sejenisnya.</li>\n</ol>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-default\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'Y', 8, 'en', 0, 0, '(((!is_empty(423492X7X19.NAOK) && (423492X7X19.NAOK == 1))))', ''),
