(23, 0, 423492, 8, 'L', 'R3B04Q025', '<p>Saat ini, apakah satuan kerja Bapak/Ibu/Saudara/I memiliki kendaraan untuk evakuasi bencana?</p>\n\n<p><span style=\"font-family:Trebuchet MS,Helvetica,sans-serif;\"><em>( Misal : mobil/motor dinas kantor/bis )</em></span>\n<style type=\"text/css\">.kondef {\n        margin-left: 10px;\n        width: 20px;\n        height: 20px;\n        border-radius: 50%;\n        outline: none;\n        border: none;\n        color: white;\n        background-color: #072438;\n    }\n\n    .kondef:focus {\n        outline: none;\n        border: none;\n    }\n\n    .kondef:active {\n        outline: none;\n        border: none;\n    }\n</style>\n<!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#425\" data-toggle=\"modal\" type=\"button\">?</button><!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung--></p>\n\n<div aria-hidden=\"true\" aria-labelledby=\"exampleModalLabel\" class=\"modal fade\" id=\"425\" tabindex=\"-1\">\n<div class=\"modal-dialog\">\n<div class=\"modal-content\">\n<div class=\"modal-header\">\n<h5 class=\"modal-title font-weight-bold\" id=\"exampleModalLabel\"><strong>Konsep dan Definisi</strong></h5>\n</div>\n<!--Yang di dalam modal-body untuk isinya (ini yang diganti)-->\n\n<div class=\"modal-body\">\n<p>Kendaraan untuk evakuasi adalah sesuatu yang digunakan untuk dikendarai atau dinaiki dalam upaya pemindahan penduduk dari daerah-daerah yang berbahaya, misalnya bahaya banjir, meletusnya gunung api, bahaya tsunami, dan sebagainya ke daerah yang aman. Kendaraan yang dimaksud adalah mobil/motor dinas kantor atau bis kantor.</p>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-primary\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'Y', 5, 'en', 0, 0, '1', ''),
