(34, 0, 423492, 8, 'F', 'R3B04Q024', 'Saat ini, apakah satuan kerja Bapak/Ibu/Saudara/i terdapat kebijakan dalam pemberian bantuan pada pegawai?\n<style type=\"text/css\">.kondef {\n        margin-left: 10px;\n        width: 20px;\n        height: 20px;\n        border-radius: 50%;\n        outline: none;\n        border: none;\n        color: white;\n        background-color: #072438;\n    }\n\n    .kondef:focus {\n        outline: none;\n        border: none;\n    }\n\n    .kondef:active {\n        outline: none;\n        border: none;\n    }\n</style>\n<!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#424\" data-toggle=\"modal\" type=\"button\">?</button> <!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung-->\n<div aria-hidden=\"true\" aria-labelledby=\"exampleModalLabel\" class=\"modal fade\" id=\"424\" tabindex=\"-1\">\n<div class=\"modal-dialog\">\n<div class=\"modal-content\">\n<div class=\"modal-header\">\n<h5 class=\"modal-title font-weight-bold\" id=\"exampleModalLabel\"><strong>Konsep dan Definisi</strong></h5>\n</div>\n<!--Yang di dalam modal-body untuk isinya (ini yang diganti)-->\n\n<div class=\"modal-body\">\n<ol>\n	<li>Pemenuhan kebutuhan dasar\n	<p>Bantuan pemenuhan kebutuhan dasar yang dimaksud adalah bantuan yang diberikan kepada korban bencana dalam bentuk penampungan sementara, bantuan pangan, sandang, air bersih dan sanitasi, dan pelayanan kesehatan.</p>\n	</li>\n	<li>Santunan duka cita\n	<p>Santunan duka cita yang dimaksud adalah santunan yang diberikan kepada korban meninggal dalam bentuk biaya pemakaman, dan/ atau uang duka.</p>\n	</li>\n	<li>Santunan kecacatan\n	<p>Santunan kecacatan yang dimaksud adalah santunan yang diberikan kepada korban bencana yang mengalami kecacatan mental dan/atau fisik.</p>\n	</li>\n</ol>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-primary\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'Y', 4, 'en', 0, 0, '1', ''),
