(42, 0, 423492, 7, 'L', 'R3B04Q002', '<p style=\"text-align: justify;\">Dalam setahun terakhir, apakah satuan kerja Bapak/Ibu/Saudara/i pernah melakukan pelatihan mitigasi dan kesiapsiagaan bencana kebakaran (simulasi/gladi peringatan bencana, sosialisasi, dan lainnya)?</p>\n<!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#r3b04q002\" data-toggle=\"modal\" type=\"button\">Penjelasan</button><!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung-->\n\n<div aria-labelledby=\"myModalLabel\" class=\"modal fade\" id=\"r3b04q002\" role=\"dialog\" tabindex=\"-1\">\n<div class=\"modal-dialog\" role=\"document\">\n<div class=\"modal-content\">\n<div class=\"modal-header\"><button aria-label=\"Close\" class=\"close\" data-dismiss=\"modal\" type=\"button\"><span aria-hidden=\"true\">×</span></button>\n\n<h4 class=\"modal-title\" id=\"myModalLabel\">Konsep dan Definisi</h4>\n</div>\n\n<div class=\"modal-body\">\n<p>Pelatihan kesiapsiagaan bencana adalah bentuk latihan koordinasi, komunikasi dan evakuasi dengan melibatkan seluruh pemangku kepentingan (pemerintah dan masyarakat umum). Pelatihan mitigasi dan kesiapsiagaan bencana dapat melalui seminar, sosialisasi, dan lain-lain</p>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-default\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'Y', 2, 'en', 0, 0, '1', ''),
(42, 0, 423492, 7, 'L', 'R3B04Q002', '<p style=\"text-align: justify;\">Dalam setahun terakhir, apakah satuan kerja Bapak/Ibu/Saudara/i pernah melakukan pelatihan mitigasi dan kesiapsiagaan bencana kebakaran (simulasi/gladi peringatan bencana, sosialisasi, dan lainnya)?</p>\n<!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#r3b04q002\" data-toggle=\"modal\" type=\"button\">Penjelasan</button><!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung-->\n\n<div aria-labelledby=\"myModalLabel\" class=\"modal fade\" id=\"r3b04q002\" role=\"dialog\" tabindex=\"-1\">\n<div class=\"modal-dialog\" role=\"document\">\n<div class=\"modal-content\">\n<div class=\"modal-header\"><button aria-label=\"Close\" class=\"close\" data-dismiss=\"modal\" type=\"button\"><span aria-hidden=\"true\">×</span></button>\n\n<h4 class=\"modal-title\" id=\"myModalLabel\">Konsep dan Definisi</h4>\n</div>\n\n<div class=\"modal-body\">\n<p>Pelatihan kesiapsiagaan bencana adalah bentuk latihan koordinasi, komunikasi dan evakuasi dengan melibatkan seluruh pemangku kepentingan (pemerintah dan masyarakat umum). Pelatihan mitigasi dan kesiapsiagaan bencana dapat melalui seminar, sosialisasi, dan lain-lain</p>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-default\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'Y', 2, 'id', 0, 0, '1', ''),
(43, 0, 423492, 5, 'L', 'R3B05Q001', '<p>Selama pandemi COVID-19, apakah satuan kerja Bapak/Ibu/Saudara/i pernah melakukan pelatihan mitigasi mengenai Covid-19 ?</p>\n\n<p>(simulasi/gladi peringatan bencana, sosialisasi, dan lainnya)?</p>\n', '', '<p><span lang=\"en\" style=\"font-size:12pt;\" xml:lang=\"en\"><span style=\"line-height:115%;\"><span style=\"font-family:\'Times New Roman\', serif;\">Isikan \"Ya\" apabila satuan kerja responden pernah melakukan pelatihan mitigasi COVID-19 melalui seminar,sosialisasi, dan lain-lain</span></span></span></p>\n', 'N', 'Y', 1, 'id', 0, 0, '1', ''),
